window.bookSummaryJSON = "<p>Abducted from Earth as a child. Sold into slavery. Forced to fly the ship of a ruthless pirate. Sarah knows nothing of her homeworld or her people. Her one longing is to return home.</p> <p>Little does she know humanity is no better off. The Elders, a ruthless alien race, rule Earth with an iron grip.</p> <p>When Sarah’s ship is ambushed by an Elder frigate she is thrown into a life and death battle. Survival would send shockwaves throughout the galaxy. Never before has an Elder warship been beaten in one-on-one combat. For Sarah, it would also open up a way for her to return to the home she has never known.</p> <p><i>The Voyage Home</i> tells the story of one young woman’s quest to find her home world and confront a galactic superpower.</p>"; 
